######################### Websocket


def on_message(ws, message):
    global curr_command_output
    global is_command_output_complete
    # custom_log("--- on message")
    # custom_log(message)
    cur_msg = json.loads(message.decode())
    # custom_log(f"msgid : {cur_msg["type"] }")
    if cur_msg["type"] == TYPE_AGENT_TICK:
        # custom_log(f"tick from agent, {cur_msg["a_id"]}")
        # custom_log(f"tick from : {cur_msg["a_id"]}")
        add_live_beacon_id(cur_msg["a_id"])

    if (
        cur_msg["type"] == TYPE_AGENT_CONSOLE_OUT
        or cur_msg["type"] == TYPE_AGENT_CONSOLE_TASK_UPD
    ):
        curr_command_output += cur_msg["a_message"] + "\n" + cur_msg["a_text"]
        if cur_msg["type"] == TYPE_AGENT_CONSOLE_TASK_UPD:
            is_command_output_complete = cur_msg["a_completed"]


def on_error(ws, error):
    pass


def on_close(ws, close_status_code, close_msg):
    pass


def on_open(ws):
    global global_ws
    global_ws = ws
    # custom_log("Opened connection")
    # custom_log("socket open")
    sync()


def sync():
    # custom_log("executing sync")
    burp0_url = f"https://{endpoint}/sync"
    burp0_headers = {
        "content-type": "application/json",
        "Connection": "close",
        "Accept-Encoding": "gzip, deflate",
        "accept-language": "en-US,*",
        "user-agent": "Mozilla/5.0",
        "Authorization": f"Bearer {auth_token}",
    }
    burp0_json = {}
    requests.post(burp0_url, headers=burp0_headers, json=burp0_json, verify=False)
    # custom_log(r.content)


def login():
    burp0_url = f"https://{endpoint}/login"
    burp0_headers = {
        "content-type": "application/json",
        "Connection": "close",
        "Accept-Encoding": "gzip, deflate",
        "accept-language": "en-US,*",
        "user-agent": "Mozilla/5.0",
    }
    burp0_json = {"password": password, "username": username}
    r = requests.post(burp0_url, headers=burp0_headers, json=burp0_json, verify=False)
    # custom_log(r.content)
    try:
        return r.json()
    except Exception:
        return r


def add_live_beacon_id(cur_b):
    global live_beacons
    for i in cur_b:
        live_beacons.add(i)


def custom_log(msg):
    threading.Thread(
        target=lambda: requests.get(f"http://127.0.0.1:3006/?={msg}")
    ).start()


def start_websocket_client():
    headers = {"Authorization": f"Bearer {auth_token}"}
    # custom_log("connecting to ws")
    ws = websocket.WebSocketApp(
        f"wss://{endpoint}/connect",
        on_open=on_open,
        on_message=on_message,
        on_error=on_error,
        on_close=on_close,
        header=headers,
    )
    ws.run_forever(sslopt={"cert_reqs": ssl.CERT_NONE})


def send_command(id: str, data: str, cmdline: str):
    global curr_command_output
    global is_command_output_complete

    curr_command_output = ""
    is_command_output_complete = False
    burp0_url = f"https://{endpoint}/agent/command/execute"
    burp0_headers = {
        "Content-Type": "application/json",
        "Authorization": f"Bearer {auth_token}",
        "Accept-Encoding": "gzip, deflate",
        "Accept-Language": "en-US,*",
        "User-Agent": "Mozilla/5.0",
    }
    # custom_log("#################")
    # custom_log(data)

    # data_json =json.loads(data)
    burp0_json = {
        "cmdline": cmdline,
        "data": json.dumps(data),
        "id": id,
        "name": "beacon",
    }
    # with open("/Users/theuser/Documents/ctf/RandomProjects/AdaptixC2_mcp/isolated/log.txt",'r') as f:
    #     f.write(str(burp0_json))
    requests.post(burp0_url, headers=burp0_headers, json=burp0_json, verify=False)

    while not is_command_output_complete:
        time.sleep(1)

    return curr_command_output


