def format_param(param, filePath=None):
    # custom_log(param)
    # custom_log(filePath)
    # custom_log("file,"+__file__)
    # custom_log("pwd"+os.getcwd())
    if filePath:
        filePath = __file__[: __file__.rfind("/")] + "/" + filePath
        # custom_log("filePath," +filePath)
        # custom_log("1")
        if not os.path.exists(filePath):
            # custom_log("2")
            return None
        with open(filePath, "rb") as f:
            file_bin = f.read()

    custom_log("doneeee")
    param_txt = param.encode() + b"\x00"

    param_data = b""
    if filePath:
        param_data += struct.pack("<I", len(file_bin)) + file_bin

    param_data += struct.pack("<I", len(param_txt)) + param_txt
    param_data = struct.pack("<I", len(param_data) + 4) + param_data
    # print(param_data)
    return base64.b64encode(param_data).decode()


