@server.tool()
def upload(beacon_id: str, local_file: str, remote_path: str):
    """description: Upload a file to the remote server
    example: upload /tmp/file.txt c:\\file.txt
    args:['FILE <local_file>', 'STRING <remote_path>']"""

    if not os.path.exists(local_file):
        return "invalid local file path"

    with open(local_file, "rb") as f:
        local_file_b64 = base64.b64encode(f.read())

    data = {
        "command": "upload",
        "local_file": f"{local_file_b64}",
        "remote_path": f"{remote_path}",
        "message": "Task: upload file",
    }
    cmdline = f"upload {local_file} {remote_path}"
    cmdline += f"{local_file}{remote_path}"

    return send_command(beacon_id, data, cmdline)


